0022MissingAge \u003c- total[is.na(total$Age), ]  \\n\u0022,\n        \u0022MeanAgesForImputed \u003c- ddply(total, c(\\\u0022Title\\\u0022, \\\u0022Pclass\\\u0022), summarize,\\n\u0022,\n        \u0022                           MeanAge = mean(Age, na.rm = TRUE))\\n\u0022,\n        \u0022MeanAgesForImputed\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022MissingAge \u003c- join(MissingAge, MeanAgesForImputed, by=c(\u0027Title\u0027, \\\u0022Pclass\\\u0022), type=\u0027left\u0027, match=\u0027all\u0027)\\n\u0022,\n        \u0022MissingAge[which(MissingAge$PassengerId == \u0027980\u0027), ]$MeanAge \u003c- median(subset(total, Title == \\\u0022Ms\\\u0022)$Age, na.rm = TRUE)\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022MissingAge\\n\u0022,\n        \u0022dim(MissingAge)\u0022\n      ]\n    },\n    {\n      \u0022cell_type\u0022: \u0022code\u0022,\n      \u0022execution_count\u0022: null,\n      \u0022metadata\u0022: {\n        \u0022_cell_guid\u0022: \u0022eb9079fc-08b0-d701-1946-22a938b805e2\u0022\n      },\n      \u0022outputs\u0022: [],\n      \u0022source\u0022: [\n        \u0022set.seed(845200)\\n\u0022,\n        \u0022train \u003c- read.csv(\u0027../input/train.csv\u0027, stringsAsFactors = F)\\n\u0022,\n        \u0022test  \u003c- read.csv(\u0027../input/test.csv\u0027, stringsAsFactors = F)\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022total  \u003c- bind_rows(train, test) \\n\u0022,\n        \u0022\\n\u0022,\n        \u0022# Extract title based on proximiy to . in string\\n\u0022,\n        \u0022total$Title \u003c- gsub(\u0027(.*, )|(\\\\\\\\..*)\u0027, \u0027\u0027, total$Name) \\n\u0022,\n        \u0022\\n\u0022,\n        \u0022# Get counts of titles\\n\u0022,\n        \u0022table(total$Title)\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022# Titles with very low cell counts to be combined to \\\u0022rare\\\u0022 level\\n\u0022,\n        \u0022#rare_title \u003c- c(\u0027Dona\u0027, \u0027Lady\u0027, \u0027the Countess\u0027,\u0027Capt\u0027, \u0027Col\u0027, \u0027Don\u0027, \\n\u0022,\n        \u0022#                \u0027Dr\u0027, \u0027Major\u0027, \u0027Rev\u0027, \u0027Sir\u0027, \u0027Jonkheer\u0027)\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022MeanAgesForImputed \u003c- ddply(total, c(\\\u0022Title\\\u0022, \\\u0022Pclass\\\u0022), summarize,\\n\u0022,\n        \u0022                           MeanAge = mean(Age, na.rm = TRUE))\\n\u0022,\n        \u0022MeanAgesForImputed\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022MissingAge = total[is.na(total$Age), ]\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022MissingAge \u003c- join(MissingAge, MeanAgesForImputed, by=c(\u0027Title\u0027, \\\u0022Pclass\\\u0022), type=\u0027left\u0027, match=\u0027all\u0027)\\n\u0022,\n        \u0022MissingAge[which(MissingAge$PassengerId == \u0027980\u0027), ]$MeanAge \u003c- median(subset(total, Title == \\\u0022Ms\\\u0022)$Age, na.rm = TRUE)\\n\u0022,\n        \u0022MissingAge$Age \u003c- MissingAge$MeanAge\\n\u0022,\n        \u0022names(MissingAge)\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022#total$Title[total$Title %in% rare_title]  \u003c- \u0027Rare\u0027\\n\u0022,\n        \u0022#total$Title[total$Title %in% rare_title]  \u003c- \u0027Rare\u0027\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022# Show title counts by sex again\\n\u0022,\n        \u0022table(total$Title)\\n\u0022,\n        \u0022\\n\u0022,\n        \u0022total$Embarked \u003c- ifelse(total$Embarked == \\\u0022\\\u0022, \\\u0022S\\\u0022, total$Embarked)\\n\u0022,\n        \u0022#total$Embarked\\n\u0022,\n        \u0022total$Surname \u003c- sapply(total$Name,  \\n\u0022,\n        \u0022                      function(x) strsplit(x, split = \u0027[,.]\u0027)[[1]][1])\\n\u0022,\n        \u0022#table(total$Surname)\\n\u0022,\n        \u0022# Create a f ll,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the “ground truth”) for each passenger. Your model will be based on “features” like passengers’ gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancés were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":1073360,"kernelVersionId":null,"isForkParent":false,"isNotebook":true,"languageName":"R","lastRunTime":"2017-04-10T21:14:40.09Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":5,"linesInsertedFromPrevious":5,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:1cc117c52236f4684b865595d1b0855a72d88ca2812d47c697fdc5359bd8c09d","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":47.0482055710017,"succeeded":true,"timeoutExceeded":false,"usedAllSpace":false},"status":"complete","title":"Exploring the Titanic dataset with R","url":"/karlkonz/exploring-the-titanic-dataset-with-r?scriptVersionId=1073360","versionNumber":290,"hasVersionNumber":true,"isRedacted":false,"versionAuthor":null},{"id":1065993,"kernelVersionId":null,"isForkParent":false,"isNotebook":true,"languageName":"R","lastRunTime":"2017-04-07T03:40:35.19Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":4,"linesInsertedFromPrevious":4,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:a236e47ea687b7714dba889be0a21997c74dbf72cebaf1deca68fc5e0b45a
